import React from 'react';
import { Link } from 'react-router-dom';

function ClientLi({ client }) {
  const { name, clientId, status } = client
  return (
    <Link to={`/client/${clientId}`}>
      <li className={ `client-${status}` }>
        {name}
      </li>
    </Link>
  )
}

export default ClientLi;
